import React from 'react'
import { useState } from 'react'
import HomeNav from './HomeNav'
import './Home.css'

let count = 0


function Home(props) {
    let chats = props.data
    // let uniqueChats = chats.map(item => item.chat.name).filter((value, index, self) => self.indexOf(value) === index)
    // console.log(uniqueChats)
    const [page, setPage] = useState('')


    return (
        <div className='container-fluid'>
            <div className="row justify-content-center">
                <div className="col">
                    <HomeNav setPage={setPage}/>
                </div>

                {chats.map((item) => {
                    count += 1
                    return (
                        <div key={count} className="row">
                            <div onClick={() => props.setPage(item.name)} className="col d-flex align-items-center justify-content-center groupChats">
                                <div className='text-center'>{item.name}</div>
                            </div>
                        </div>
                    )
                })}
            </div>

        </div>
    )
}

export default Home
